var tipuesearch = {"pages": [{'title': 'About', 'text': 'pj3第四組 \n 組長：洪偉陞 41023146 \n 組員：施建菖 41023143 紀閔翔 41023147 夏進源 41023148 \n 呂佳柔 41023104 王啟騰 41023112 李承翰 41023121 林建維 41023134 \n 網頁: https://mdecd2023.github.io/2a3-pj3ag4/content/index.html \xa0 \n 倉儲: https://github.com/mdecd2023/2a3-pj3ag4 \xa0 \n', 'tags': '', 'url': 'About.html'}, {'title': 'jitsi', 'text': '', 'tags': '', 'url': 'jitsi.html'}, {'title': '協同過程', 'text': '一 .0515協同過程 \n \xa0 \xa0  1.分配PJ3的任務: \n \xa0 \xa0 \xa0 \xa0 41023146:負責目標2,3,4 , 7 \n \xa0 \xa0 \xa0 \xa0 41023147,41023143:負責目標4,5 \n \xa0 \xa0 \xa0 \xa0 41023112,41023104:負責目標6 \n \xa0 \xa0 \xa0 \xa0 41023148:負責目標1,6 \n \xa0 \xa0 \xa0 \xa0 41023121,41023134:負責簡報 \n \n \n ==', 'tags': '', 'url': '協同過程.html'}, {'title': 'pj3', 'text': "pj3目標: \n 1.場景中的計時器(.ttm)(✅) \n 2.添加球員擊球技能、球員倒地再站起 \n 3.球進球框不刪除改收集(圖檔已完成、只缺更改名稱的函式)(✅) \n 4.球員移動優化(例如:前進可以加右轉一起)(✅) \n 5.設計球員新外型(✅) \n 6.另外以建立以機械轉盤傳動計分系統(.ttm) \n 7.將記分板系統改為.ttm格式(✅) \n --- \n 完成進度: \n 1.第七點完成 ( pj3ag4_zmq_bubbleRob1.7z ,  scoreboard.ttm ) \n \xa0◉scoreboard.ttm中不含感測器只要將場景中感測器改名為sensor1、sensor2就可以用了(要跟board同一層) \n 2.第三點完成 ( pj3ag4_zmq_bubbleRob2.7z ) \n \xa0◉將sim.removeObject(ball)---刪除球 改為\xa0sim.setObjectAlias(ball, 'ball')---將球改名(球原本名稱為Sphere) \n 3.第五點完成 ( brickRob.ttm ) \n \xa0◉將原本車體改為磚塊型，除了解決車體本身會倒的問題之外，還將前進原理更改為四軸驅動，使轉彎更為順暢及合理。 \n \n 4.第四點完成 ( brickRob.7z ) 延伸更新:( brickRob2.7z ) \n \xa0◉將原本上相左右同時只能執行一個,改為前後可跟左右一起執行,操作性有很大的提升 \n \xa0 ◉延伸更新為第二種車體運作方式，其原理為更改整個車體角度使其變換方向 \n 5.第六點半完成 ( 機械計分板.rar & 機械記分板.ttt ) \n ◉CoppeliaSim4.3.0和CoppeliaSim4.5的版本不相容 嘗試啟動記分板.ttt 是使用4.3.3版本開啟的齒輪之間會有所卡頓還需改正齒輪外型 \n 修改後圖檔( scoreboard3.ttt \xa0 scoreboard3.ttm ) \n ◉ 將圖檔重畫後再重新導進 CoppeliaSim中,將齒輪的質量和慣性矩調整後即可順利運行 \n 6.修改尺寸並將磚塊型車體導入場景 ( zmq_brickRob1.7z ) \n \xa0◉修改足球大小 \n \xa0◉更改感測器位置 \n 7.完成計時器及調整計分板顏色 ( timer.ttm , scoreboard2.ttm ) \n \xa0◉利用sim.getSimulationTime()函數獲得模擬時間並配合記分板程式,完成實體計時器製作 \n \xa0◉將計分板改為黑底白字(將程式修改為停止模擬時分數歸零) \n 8.更改球員外型 ( player.7z ) \n \xa0◉添加球員手部 \n \xa0◉球員本體用導入的開啟碰撞會抖動，所以我加入skin物件(球員外型)然後將本體隱藏 \n \n \n \n \n \n", 'tags': '', 'url': 'pj3.html'}]};